CREATE DATABASE  IF NOT EXISTS `almacen`;

USE `almacen`;

CREATE TABLE IF NOT EXISTS `dato` ( 
	id INT UNSIGNED NOT NULL AUTO_INCREMENT, 
	activo CHAR(15) NOT NULL, criterio CHAR(50) NOT NULL, 
	fecha DATE NOT NULL, 
	valor DECIMAL(25,10) NOT NULL, 
	PRIMARY KEY (id), 
	INDEX unico (activo, criterio, fecha), 
	INDEX sesion (fecha) 
) ENGINE = InnoDB DEFAULT CHARSET=utf8;

LOCK TABLES `dato` WRITE;


UNLOCK TABLES;
